import { useState } from 'react';
import { Shield, ArrowRight, Users, TrendingUp, Check, Sparkles, CreditCard } from 'lucide-react';
import { AuthModal } from '../components/auth/AuthModal';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

export function LandingPage() {
  const [showAuthModal, setShowAuthModal] = useState(false);

  return (
    <div className="min-h-screen bg-gradient-to-br from-[#1a2942] via-[#223c63] to-[#234876]">
      {/* Modale d'authentification */}
      {showAuthModal && (
        <AuthModal onClose={() => setShowAuthModal(false)} />
      )}

      {/* Hero Section */}
      <section className="min-h-screen flex flex-col items-center justify-center px-4 py-20 relative overflow-hidden">
        {/* Motif géométrique discret */}
        <div className="absolute inset-0 opacity-5">
          <div className="absolute inset-0" style={{
            backgroundImage: 'radial-gradient(circle, #c5a572 1px, transparent 1px)',
            backgroundSize: '30px 30px'
          }}></div>
        </div>

        {/* Contenu principal */}
        <div className="max-w-6xl mx-auto text-center relative z-10">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <h1 className="text-5xl md:text-6xl font-bold text-white mb-6">
              Optimisez votre fiscalité avec Francis
            </h1>
            <p className="text-xl text-gray-300 mb-12 max-w-3xl mx-auto">
              Votre assistant fiscal intelligent qui vous aide à optimiser vos impôts et à prendre les meilleures décisions financières.
            </p>
          </motion.div>

          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            className="flex flex-col sm:flex-row gap-4 justify-center mb-16"
          >
            <button
              onClick={() => setShowAuthModal(true)}
              className="px-8 py-4 bg-gradient-to-r from-[#c5a572] to-[#e8cfa0] text-[#1a2942] font-bold rounded-xl hover:shadow-lg hover:shadow-[#c5a572]/20 transition-all transform hover:scale-105"
            >
              Commencer gratuitement
            </button>
            <Link
              to="/dashboard"
              className="px-8 py-4 bg-white/10 text-white font-bold rounded-xl hover:bg-white/20 transition-all transform hover:scale-105"
            >
              Voir la démo
            </Link>
          </motion.div>

          {/* Fonctionnalités */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mt-20">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="bg-white/5 backdrop-blur-sm rounded-2xl p-8 border border-[#c5a572]/20"
            >
              <div className="w-12 h-12 bg-[#c5a572]/20 rounded-xl flex items-center justify-center mb-6">
                <Shield className="w-6 h-6 text-[#c5a572]" />
              </div>
              <h3 className="text-xl font-bold text-white mb-4">Analyse Intelligente</h3>
              <p className="text-gray-300">
                Analysez vos documents fiscaux et recevez des recommandations personnalisées.
              </p>
            </motion.div>

            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.6 }}
              className="bg-white/5 backdrop-blur-sm rounded-2xl p-8 border border-[#c5a572]/20"
            >
              <div className="w-12 h-12 bg-[#c5a572]/20 rounded-xl flex items-center justify-center mb-6">
                <TrendingUp className="w-6 h-6 text-[#c5a572]" />
              </div>
              <h3 className="text-xl font-bold text-white mb-4">Optimisation Automatique</h3>
              <p className="text-gray-300">
                Optimisez automatiquement vos impôts grâce à notre intelligence artificielle.
              </p>
            </motion.div>

            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.8 }}
              className="bg-white/5 backdrop-blur-sm rounded-2xl p-8 border border-[#c5a572]/20"
            >
              <div className="w-12 h-12 bg-[#c5a572]/20 rounded-xl flex items-center justify-center mb-6">
                <CreditCard className="w-6 h-6 text-[#c5a572]" />
              </div>
              <h3 className="text-xl font-bold text-white mb-4">Intégration Bancaire</h3>
              <p className="text-gray-300">
                Connectez votre compte bancaire pour une analyse complète de vos finances.
              </p>
            </motion.div>
          </div>
        </div>
      </section>
    </div>
  );
}
